import React from 'react';

function Header() {
  return (
    <header>
      <nav>
        <ul>
          <li><a href="/">Главная</a></li>
          <li><a href="/register">Регистрация</a></li>
        </ul>
      </nav>
      <div className="search-bar">
        <input type="text" placeholder="Поиск..." />
        <button type="submit">Поиск</button>
      </div>
    </header>
  );
}

export default Header;
